import os
import random

from django import template
from django.conf import settings
from django.templatetags.static import static
from django.utils.safestring import mark_safe

register = template.Library()


@register.simple_tag(takes_context=True)
def fslogo(context):
    request = context["request"]
    if request.user.is_authenticated and random.randint(0, 100) == 0:  # nosec: fully defined
        return mark_safe(  # nosec: fully defined
            "<img height='24' class='d-inline-block align-text-top' "
            "<img src='data:image/svg+xml;base64,"
            "' "  # noqa: E501
            "alt='Logo' />",
        )  # linebreaks are intentionally this way :)
    return mark_safe(  # nosec: fully defined
        "<img height='24' class='d-inline-block align-text-top' "
        f"src='{static('piggy-bank-fill.svg')}' "
        "alt='Logo'> Finanztool",
    )


@register.simple_tag
def fslogo_path():
    return f'{{{os.path.join(settings.STATIC_ROOT, "eule_original.png")}}}'
